Game Description:
******************
A game of fantasy guild management! In It's A Wipe! you assume the role of a guild leader within a fantasy game world. You must recruit other players, lead them to victory against increasingly difficult odds, and make sure that your group remains happy enough to stick with you! The game is done in a style reminiscent of old school role playing games. While the 'game' within It's A Wipe! is supposed to represent an on-line game world, this is really a single player game. The game play is a mix of strategy, in that you need to figure out an effective plan to beat the encounters, and management, in that you need to balance the various needs and desires of your team of players.

